Weeks 20-28 of TEMPLATE, an ongoing digital comics series from QAM Comics. Fans of Thrillbent, Monkeybrain, or DC Digital First style comics should definitely check it out.


Series Description: TEMPLATE is an action thriller with cyberpunk flair. Centering on a private security organization called Oversight, the story chronicles their attempts to make the perfect android soldier. When the first attempt fails, they speed up plans to try again under the assumption they learned from their mistakes. It is at this point that the main character, Beta, is created. Over the course of the series, her development is followed as she explores her own personality and discovers what she can and can not do not being in full control of herself.


